func (s *p0208TestSuite) Test() {
	trie := Constructor()
	insertWord := []string{"abc", "acd", "abcd", "ade"}
	startsCases := []struct {
		arg1   string
		target bool
	}{
		{
			arg1:   "a",
			target: true,
		},
		{
			arg1:   "ade",
			target: true,
		},
		{
			arg1:   "ac",
			target: true,
		},
		{
			arg1:   "abc",
			target: true,
		},
		{
			arg1:   "ecd",
			target: false,
		},
	}
	searchCases := []struct {
		arg1   string
		target bool
	}{
		{
			arg1:   "acd",
			target: true,
		},
		{
			arg1:   "ade",
			target: true,
		},
		{
			arg1:   "a",
			target: false,
		},
		{
			arg1:   "ac",
			target: false,
		},
		{
			arg1:   "ecd",
			target: false,
		},
	}
	_ = startsCases
	_ = searchCases

	for _, word := range insertWord {
		trie.Insert(word)

	}
	printTrie(trie.n, "")
	fmt.Println("----------")

	for _, search := range searchCases {
		s.Equal(search.target, trie.Search(search.arg1))
	}
	for _, starts := range startsCases {
		s.Equal(starts.target, trie.StartsWith(starts.arg1))
	}
}

func TestP0208TestSuite(t *testing.T) {
	s := &p0208TestSuite{}
	suite.Run(t, s)
}
